export default <style>{`
    body{
        margin:10px;
    }
    h1{
        font-size:68pt;
        font-Weight:bold;
        text-aligin:right;
        letter-spacing:-9px;
        color:#f0f0f0;
        margin:-32px 0px;
    }
    p{
        margin:0px;
        color:#666;
        font-size:16pt;
    }

`}</style>;
